column8:
●ネコのフン尿のニオイを消臭し、ネコの嫌がるペパーミント、チモール、テレピン、ワサビのニオイで寄せつけません。<br>
●効きめは約1週間持続。<br><br>

【用途】<br>
猫専用忌避剤<br><br>

【使用方法】<br>
●使用開始時に天面のストッパーを上におこしてパキッと音がするまで後ろの方に曲げて折りとってください。<br>
●噴射レバーを引き、猫が寄ってきて困っている場所（20cm×20cm）に約3秒（約40cm以上離して）噴射してください。猫のフンや生ゴミなど猫を引き寄せるおそれがある場合は、あらかじめそれらを取り除いてから処理してください。<br>
●ゴミを出すとき、ゴミ置き場、ゴミ箱、ゴミ袋などに直接スプレーしてください。<br><br>

【使用場所】<br>
外壁、玄関まわり、家のまわり、駐車場、花壇まわり、ゴミ置き場<br>
※植物には直接かけないこと。枯れるおそれがあります。<br><br>

【ご注意】<br>
○本品は屋外専用です。室内ではニオイが残るので使用しないでください。<br>
○人やペットには薬剤をかけないでください。<br>
○薬剤が水槽、池、川などに入らないよう注意してください。<br>
○植物に直接かかると薬害がでる場合があります。<br>
○アレルギーやかぶれなどを起こしやすい体質の人、喘息の症状のある人は、薬剤を吸い込んだり、触れたりしないでください。体調がすぐれない時は使用しないでください。<br>
○壁や塀に使用する場合、まれに変色やシミになるおそれがあるので試し噴射してから使用してください。<br>
○人体に向かって噴射しないでください。また、噴射気体を吸入しないでください。<br>○噴射中は喫煙、飲食等はしないでください。<br>
○薬剤が皮膚についた場合は直ちに石けんでよく洗い、目に入った場合はすぐに水洗いし、異常を感じた場合は、直ちに医師の診療を受けてください。<br>
○変色、シミの原因となりますので、自動車、門扉、シャッター、その他の塗装面や大理石等にはかからないように注意してください。薬剤がかかった場合は直ちに洗い落としてください。<br>
○効果の持続時間は天候や温度条件により異なります。<br>
○ニオイに対して鈍くなっている猫や空腹、発情期の猫には効果が劣る場合があります。このような場合にはニオイによる忌避以外の対策が必要です。<br>
○直射日光や火気を避け、子供の手の届かない涼しいところに保管してください。<br>
○缶のさびを防ぐため、水周りや湿気の多い場所には置かないでください。<br>
○本品は使い切ってから捨てること。<br>
○捨てるときは、風通しが良く、火気のない屋外で、風下に向かって人にかからないように噴射レバーを引き、噴射音が消えるまでガスを抜いて、燃えないゴミとして捨てること。その際、噴射レバーを引いたまま、黄色のスプレーキャップ側面の孔につまようじ等を差込むと、噴射レバーがロックされ最後までガスを抜くことができます。噴射が不十分な場合は、つまようじ等を押し下げると最後まで噴射できます。<br><br>

【成分】<br>
消臭成分、チモール、植物精油(ペパーミントオイル、テレピンオイル、天然ワサビオイル)<br><br>

【内容量】<br>
450ml<br><br>

